		}
		var aliasEntityId = '';
		aliasEntityId = aliasEntityId != '' ? aliasEntityId :  'com.comtop.workflowtest.entity.TestMmReceiptNotice';
		var dwrInvokeParam = cap.getDwrInvokeParam(aliasEntityId,'saveItemRelation',paramArray);
		var result;
		dwr.TOPEngine.setAsync(false);
		WorkflowTestEditPageForWorkFlowAction.dwrInvoke(dwrInvokeParam,{callback:function(_result){
			//赋值前操作
			result = _result;
			if(""!="testMmReceiptNotice.id"){
				eval("testMmReceiptNotice.id=_result");
			}


			//默认保存成功
			var type = 'success';
			var message = '保存成功！';

			cui.message(message, type,{'callback':function(){
				//回调的操作

				if(type != "success"){
					return;
				}
				var pWindow = cap.searchParentWindow("reloadGridData");
				if(pWindow && typeof pWindow["reloadGridData"] === "function"){
					pWindow["reloadGridData"]();
				}
